CREATE TABLE MARCA (
  id             int(10) NOT NULL AUTO_INCREMENT, 
  marca          varchar(45) NOT NULL, 
  img_logo       longblob NOT NULL, 
  img_banner     longblob, 
  fecha_registro date NOT NULL DEFAULT CURRENT_DATE,
  disponibilidad tinyint(1) NOT NULL, 
  PRIMARY KEY (id));

CREATE TABLE PRODUCTO (
  id             int(10) NOT NULL AUTO_INCREMENT, 
  nombre         varchar(150) NOT NULL, 
  price_regular  numeric(9, 2), 
  precio_online  numeric(9, 2) NOT NULL, 
  precio_oferta  numeric(9, 2), 
  calificacion   numeric(5, 2) NOT NULL, 
  info_adicional text NOT NULL, 
  stock          int(11) NOT NULL, 
  fecha_registro date NOT NULL DEFAULT CURRENT_DATE, 
  disponibilidad tinyint(1) NOT NULL, 
  MARCAid        int(10) NOT NULL, 
  SUBCATEGORIAid int(10) NOT NULL, 
  PRIMARY KEY (id));

CREATE TABLE SUBCATEGORIA (
  id             int(10) NOT NULL AUTO_INCREMENT, 
  subcategoria   varchar(50) NOT NULL, 
  faicon_subcat  varchar(50) NOT NULL, 
  disponibilidad tinyint(1) NOT NULL, 
  CATEGORIAid    int(10) NOT NULL, 
  PRIMARY KEY (id));
  
CREATE TABLE CATEGORIA (
  id             int(10) NOT NULL AUTO_INCREMENT, 
  categoria      varchar(50) NOT NULL, 
  faicon_cat     varchar(50) NOT NULL, 
  disponibilidad tinyint(1) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE PEDIDO (
  id            int(10) NOT NULL AUTO_INCREMENT, 
  fecha_compra  int(11) NOT NULL, 
  fecha_envio   int(11) NOT NULL, 
  fecha_entrega int(11), 
  subtotal      int(11) NOT NULL, 
  METODO_PAGOid int(11) NOT NULL, 
  USUARIOid     int(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE USUARIO (
  id               int(10) NOT NULL AUTO_INCREMENT, 
  nombres          varchar(50) NOT NULL, 
  apellidos        varchar(50) NOT NULL, 
  doc_identidad    varchar(15) NOT NULL, 
  genero           tinyint(1) NOT NULL, 
  fecha_nacimiento date NOT NULL, 
  telefono         varchar(15) NOT NULL, 
  correo           varchar(60) NOT NULL, 
  contraseña       varchar(40) NOT NULL, 
  disponibilidad   tinyint(1) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE DIRECCION (
  id           int(11) NOT NULL AUTO_INCREMENT, 
  direccion    varchar(255) NOT NULL, 
  referencia   varchar(255) NOT NULL, 
  ciudad       varchar(255) NOT NULL, 
  provincia    varchar(255) NOT NULL, 
  departamento varchar(255) NOT NULL, 
  USUARIOid    int(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE IMG_PRODUCTO (
  id           int(10) NOT NULL AUTO_INCREMENT,
  img_nombre   varchar(100) NOT NULL,
  imagen       longblob NOT NULL, 
  imgPrincipal tinyint(1) NOT NULL, 
  PRODUCTOid   int(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE DETALLES_PEDIDO (
  PRODUCTOid int(10) NOT NULL, 
  PEDIDOid   int(10) NOT NULL, 
  cantidad   int(2) NOT NULL, 
  PRIMARY KEY (PRODUCTOid, 
  PEDIDOid));
CREATE TABLE LISTA_DESEOS (
  PRODUCTOid int(10) NOT NULL, 
  USUARIOid  int(10) NOT NULL, 
  PRIMARY KEY (PRODUCTOid, 
  USUARIOid));
CREATE TABLE COMENTARIO (
  id                  int(11) NOT NULL AUTO_INCREMENT, 
  nombres             varchar(50) NOT NULL, 
  apellidos           varchar(50) NOT NULL, 
  email               varchar(70) NOT NULL, 
  celular             varchar(80) NOT NULL, 
  mensaje             text NOT NULL, 
  fecha_registro date NOT NULL DEFAULT CURRENT_DATE, 
  MOTIVO_COMENTARIOid int(11) NOT NULL, 
  ESTADO_COMENTARIOid int(11) NOT NULL, 
  USUARIOid           int(10), 
  PRIMARY KEY (id));
CREATE TABLE MOTIVO_COMENTARIO (
  id             int(11) NOT NULL AUTO_INCREMENT, 
  motivo         varchar(50) NOT NULL, 
  disponibilidad tinyint(1) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE TIPO_NOVEDAD (
  id      int(10) NOT NULL AUTO_INCREMENT, 
  nomTipo varchar(55) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE NOVEDAD (
  id                int(10) NOT NULL AUTO_INCREMENT, 
  nombre            varchar(55) NOT NULL, 
  titulo            varchar(55) NOT NULL, 
  fecha_inicio      date NOT NULL, 
  fecha_vencimiento date NOT NULL, 
  terminos          text NOT NULL, 
  fecha_registro date NOT NULL DEFAULT CURRENT_DATE, 
  disponibilidad    tinyint(1) NOT NULL, 
  MARCAid           int(10), 
  SUBCATEGORIAid    int(10), 
  TIPO_NOVEDADid    int(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE CARACTERISTICA_SUBCAT (
  id             int(11) NOT NULL AUTO_INCREMENT, 
  campo          varchar(50) NOT NULL, 
  SUBCATEGORIAid int(10) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE CARACTERISTICA_PRODUCTO (
  CARACTERISTICA_SUBCATid int(11) NOT NULL, 
  PRODUCTOid              int(10) NOT NULL, 
  valor                   varchar(50) NOT NULL, 
  principal               tinyint(1) NOT NULL, 
  PRIMARY KEY (CARACTERISTICA_SUBCATid, 
  PRODUCTOid));
CREATE TABLE ESTADO_COMENTARIO (
  id     int(11) NOT NULL AUTO_INCREMENT, 
  estado varchar(50) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE METODO_PAGO (
  id             int(11) NOT NULL AUTO_INCREMENT, 
  disponibilidad tinyint(1) NOT NULL, 
  PRIMARY KEY (id));
CREATE TABLE TIPO_IMG_NOVEDAD (
  id             int(11) NOT NULL AUTO_INCREMENT, 
  tipo           varchar(50) NOT NULL, 
  disponibilidad tinyint(1) NOT NULL, 
  PRIMARY KEY (id)); 
CREATE TABLE IMG_NOVEDAD (
  id                 int(11) NOT NULL AUTO_INCREMENT, 
  nomImagen          varchar(100) NOT NULL, 
  imagen             longblob NOT NULL, 
  TIPO_IMG_NOVEDADid int(11) NOT NULL, 
  NOVEDADid          int(10) NOT NULL, 
  PRIMARY KEY (id));

